function ip2hex () {
echo -n $1 | awk -F '.' '{printf "0x%x", ($1 * 2^24) + ($2 * 2^16) + ($3 * 2^8) + $4}'

}

function ip2long () {
echo -n $1 | awk -F '.' '{printf "%d", ($1 * 2^24) + ($2 * 2^16) + ($3 * 2^8) + $4}'

}

