function start_ngrok () {
    if [[ $usingngrok == 0 ]]
        then
            ngrok tcp $PORT > /dev/null &
            header
            echo "Starting ngrok.."
        while ! nc -z localhost 4040; do
            sleep 1 # wait ngrok to become available
        done
        sleep 2
        public_url=$(curl -s http://localhost:4040/api/tunnels | jq -r '.tunnels[0].public_url'|awk -F"//" {'print $2'})
        local_url=$(curl -s http://localhost:4040/api/tunnels | jq -r '.tunnels[0].config.addr')
        ngrokIP=$(echo -n $public_url|awk -F":" {'print $1'})
        ngrokPORT=$(echo -n $public_url|awk -F":" {'print $2'})
        LOCALPORT=$(echo -n $local_url|awk -F":" {'print $2'})
        usingngrok=1
      
        

        mainmenu
    else
        killall ngrok > /dev/null 2>&1
        usingngrok=0
        mainmenu
    fi

}

function start_updog () {

    if [[ $usingupdog == 0 ]]
        then
            updog -d $updog_dir -p $updog_port > /dev/null &
            header
            echo "Starting Updog..."
        while ! nc -z localhost $updog_port; do
            sleep 1 # wait updog to become available
        done
        usingupdog=1
        mainmenu
    else
        ps -ef | grep updog |cut -d" " -f4| while read -r pid;do kill "$pid";done > /dev/null 2>&1
        header
        usingupdog=0
        mainmenu
    fi

}

